                "At first, this was going to be a simple selfcest smut fic, but once that Decartes quote came in, I decided to make it something truly unique and blend philosophy, transsexuality, and uhh, giving head. My favorite part was recurring elements in the story and allegories (something I got from recently listening to Hamilton).",
                "One of the major ones was Virto\\u2019s music being an allegory for wanting to be her true self, as it \\u201cstarted playing\\u201d on her own, even when she \\u201cturned it off.\\u201d She got a lot of curation from friends who also didn\\u2019t fit in or could at least fit in better, like Lalu and Leana, and other small details I liked.",
                "The other major one is the use of one of Ren\xE9 Descartes\\u2019s more famous contributions to process her life in a digestible and hopeful way. For me, I found that I can attribute a lot of my personal philosophy to taking a humanities class and being exposed to a bunch of different ideologies, then ending up on channels like Unsolicited Advice and FD Signifier. It\\u2019s like your mind is a car garage, and while you park your car there, you can also fill it with a bunch of other stuff like tools so that if you ever need to fix your car, you have a wide variety of options to choose from instead of being limited to calling the dealership, you know?\\nAs for other neat literary occurrences, I\\u2019ll leave it up to you to interpret. I just loved writing and philosophy, and it\\u2019s played a big role in who I\\u2019ve become. Hope you enjoyed the story! Or the smut lol.",
